import React from 'react';
import { Link } from 'react-router-dom'
import AwesomeSlider from 'react-awesome-slider';
import { GiBarracks } from "react-icons/gi";
import { GoCloudDownload, GoCreditCard, GoBell, GoDeviceDesktop } from "react-icons/go";
import { Container } from '../BarraLateral/styled';

export default function BarraLateral() {
  return (
    <Container>

      <div id="Icones">
        <div id="icones1">
          <GiBarracks class="icone" size={27} color="#fff" />
        </div>
        <div id="icones2">
          <GoCloudDownload size={27} color="#fff" />
        </div>
        <div id="icones3">
          <GoCreditCard size={27} color="#fff" />
        </div>
        <div id="icones4">
          <GoDeviceDesktop size={27} color="#fff" />
        </div>
        <div id="icones5">
          <GoBell size={27} color="#fff" />
        </div>
      </div>
    </Container>
  )

}
